import { useEffect, useState } from 'react';

function Whatsapi() {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
      // Reemplaza 'PAGE_ID' y 'ACCESS_TOKEN' con tu ID de página y token de acceso
      const pageId = '100064278240012';
      const accessToken = '716244130372865';
  
      fetch(`https://graph.facebook.com/v12.0/${pageId}/feed?access_token=${accessToken}`)
        .then((response) => response.json())
        .then((data) => {
          if (data.data) {
            setPosts(data.data);
          }
        })
        .catch((error) => console.error(error));
    }, []);
  
    return (
      <div>
        {posts.map((post) => (
          <div key={post.id}>
            {/* Renderiza cada publicación */}
            <p>{post.message}</p>
          </div>
        ))}
      </div>
    );
  }
export default Whatsapi;
